import React, { Component } from 'react';
import '../styles/navbar.css';

const NavBar = () => {
    return (
        <div className="navbar">
            <nav className="navbar navbar-expand-lg navbar-bg-color ">
                <div className="container primary-nav-border">
                    <a className="navbar-brand" href="#">Primary Navbar</a>
                </div>
            </nav>
            <nav className="navbar navbar-expand-lg navbar-bg-color secondary-nav">
            <div className="container">
                <a className="navbar-brand" href="#">Secondary Navbar</a>
            </div>
        </nav>
    </div>
    );
}

export default NavBar;
